package bigbang;

public class bigbang {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
for(int a=1;a<=20;a++)
{		
		if(a%3==0&&a%5==0)
		{
		System.out.println("bigbang");
		}
	
		else if(a%3==0)
		{
			System.out.println("big");
		}
        else if(a%5==0)
			{
				System.out.println("bang");
			}
        else
        {
        	System.out.println(a);
			}
				
}
	}
}






